import React from 'react';
import classes from './OverviewContentDiv.module.css';
import base from '../../CommonAppUtilities/AppContentDiv.module.css';
import TopSwitchBarTeacher from './components/Teacher/TopSwitchBar';
import ClassShortViewTeacher from './components/Teacher/ClassShortViewTeacher';



const OverviewContentDiv=()=>{




return (

<div className={base.appContentDiv}>


<div className={classes.contentDiv}>



   <TopSwitchBarTeacher/>


   <ClassShortViewTeacher/>

   <ClassShortViewTeacher/>


   <ClassShortViewTeacher/>

   <ClassShortViewTeacher/>









</div>


</div>	

);

}


export default OverviewContentDiv;
